angular.module("application.templates",[]).run(["$templateCache",function(n){n.put("todo_menu.html",'<md-list flex ng-controller="TodoMenuController">\r\n    <md-list-item ng-click="todo()">\r\n        <md-icon style="color: blue">dashboard</md-icon>\r\n        <p>{{ \'title_dashboard\' | translate }}</p>\r\n    </md-list-item>\r\n</md-list>'),n.put("todo/todo.html",'<md-content flex layout="row" md-swipe-left="close()" md-swipe-right="menu()" md-theme="{{theme}}">\r\n    <md-sidenav class="md-sidenav-left md-whiteframe-z2" md-component-id="menu" md-is-locked-open="$mdMedia(\'gt-md\')">\r\n        <md-toolbar class="app-toolbar md-whiteframe-z2" ng-animate="animate" md-component-id="&quot;menu">\r\n            <div class="md-toolbar-tools">\r\n            {{ \'title_menu\' | translate }}\r\n            </div>\r\n        </md-toolbar>\r\n        <ng-include src="\'todo_menu.html\'"></ng-include>\r\n    </md-sidenav>    \r\n    \r\n    <md-content flex layout="column">\r\n        <md-toolbar class="md-whiteframe-z2" md-scroll-shrink>\r\n            <div class="md-toolbar-tools" ng-if="theme == \'teal\'">\r\n                <md-button class="md-icon-button" hide-gt-md ng-click="menu()">\r\n                    <md-tooltip>{{ \'action_menu\' | translate }}</md-tooltip>\r\n                    <md-icon>menu</md-icon>\r\n                </md-button>\r\n                <h2 class="md-title">{{ \'title_todo_pouchdb\' | translate }}</h2>\r\n                <span flex></span>\r\n                <md-button class="md-icon-button" ng-click="$ = \'white\'">\r\n                    <md-tooltip>{{ \'action_email\' | translate }}</md-tooltip>\r\n                    <md-icon>email</md-icon>\r\n                </md-button>\r\n                <md-button class="md-icon-button" ng-click="$ = \'white\'">\r\n                    <md-tooltip>{{ \'action_notifications\' | translate }}</md-tooltip>\r\n                    <md-icon>notifications</md-icon>\r\n                </md-button>\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'white\'">\r\n                    <md-tooltip>{{ \'action_search\' | translate }}</md-tooltip>\r\n                    <md-icon>search</md-icon>\r\n                </md-button>\r\n            </div>\r\n\r\n            <div class="md-toolbar-tools" ng-if="theme == \'white\'">\r\n                <md-button class="md-icon-button" ng-click="$parent.theme = \'teal\'">\r\n                    <md-tooltip>{{ \'action_back\' | translate }}</md-tooltip>\r\n                    <md-icon>arrow_back</md-icon>\r\n                </md-button>\r\n                <md-input-container flex md-no-float>\r\n                    <br>\r\n                    <input ng-model="$parent.query.$" placeholder="{{ \'action_search\' | translate }}" type="search">\r\n                </md-input-container>\r\n                <md-button class="md-icon-button" ng-click="reset()">\r\n                    <md-tooltip>{{ \'action_reset\' | translate }}</md-tooltip>\r\n                    <md-icon>cancel</md-icon>\r\n                </md-button>\r\n            </div>\r\n        </md-toolbar>\r\n        \r\n        <div>\r\n        <md-content layout-padding>\r\n                <form name="userForm">        \r\n                <md-input-container>\r\n                  <label>Title</label>\r\n                  <input ng-model="user.title">\r\n                </md-input-container>\r\n                <md-input-container>\r\n                  <label>Email</label>\r\n                  <input ng-model="user.email" type="email">\r\n                </md-input-container>\r\n                  <div layout layout-sm="column">\r\n                    <md-input-container style="width:70%">\r\n                        <label>Company (Disabled)</label>\r\n                        <input ng-model="user.company" disabled="disabled">\r\n                      </md-input-container>\r\n                    <md-datepicker ng-model="user.submissionDate" md-placeholder="Enter date"></md-datepicker>\r\n                  </div>\r\n                  <div layout layout-sm="column">\r\n                    <md-input-container flex>\r\n                      <label>First name</label>\r\n                      <input ng-model="user.firstName">\r\n                    </md-input-container>\r\n                    <md-input-container flex>\r\n                      <label>Last Name</label>\r\n                      <input ng-model="theMax">\r\n                    </md-input-container>\r\n                  </div>\r\n                  <md-input-container flex>\r\n                    <label>Address</label>\r\n                    <input ng-model="user.address">\r\n                  </md-input-container>\r\n                  <md-input-container md-no-float>\r\n                    <input ng-model="user.address2" placeholder="Address 2">\r\n                  </md-input-container>\r\n                  <div layout layout-sm="column">\r\n                    <md-input-container flex>\r\n                      <label>City</label>\r\n                      <input ng-model="user.city">\r\n                    </md-input-container>\r\n                    <md-input-container flex>\r\n                      <label>State</label>\r\n                      <input ng-model="user.state">\r\n                    </md-input-container>\r\n                    <md-input-container flex>\r\n                      <label>Postal Code</label>\r\n                      <input ng-model="user.postalCode" placeholder="12345">\r\n                    </md-input-container>\r\n                  </div>\r\n                  <md-input-container flex>\r\n                    <label>Biography</label>\r\n                    <textarea ng-model="user.biography" columns="1" md-maxlength="150"></textarea>\r\n                  </md-input-container>\r\n                <md-button class="md-raised md-primary" ngclick="send()">Send</md-button>\r\n                </form>\r\n              </md-content>\r\n            </div>\r\n    </md-content>\r\n</md-content>')}]);